import React from "react";
import "./City.css";
import Card from "../../UI/Card";
const City = (props) => {
  return (
    <Card className="city">
      <img src={props.item.image} alt=""></img>
      <div className="city-detail">
        <p className="name">{props.item.name}</p>
        <p className="subText">{props.item.subText}</p>
      </div>
    </Card>
  );
};

export default City;
